const BallRadius=3;
const AnimationMax=250;
const LowerLimitOfTransparency=100;

let canvas=document.querySelector("canvas");
canvas.width = document.body.clientWidth;
canvas.height = document.body.clientHeight;
let context=canvas.getContext("2d");
let width=canvas.width;
let height=canvas.height;
let cx=width/2;
let cy=height/2;

let ImageBalls=[];
img.onload=function ()
{
    imageload(img);
}

window.addEventListener("resize", function(){
    canvas.width = document.body.clientWidth;
    canvas.height = document.body.clientHeight;
  }, true);

  //生成[0,Max]的随机数
function GetRandom(Max)
{
    return Math.random()*Max;
}

function check(data,i)
{
    return data[i]<100&&data[i+1]<100&&data[i+2]<100;
}

//加载图片，使其转换成点阵
function imageload(img)
{
    context.clearRect(0,0,img.width,img.height);
    context.drawImage(img,0,0);
    let copy=context.getImageData(0,0,img.width,img.height);
    context.clearRect(0,0,img.width,img.height);
    for(let i=0;i<copy.data.length;i+=12)
        if(check(copy.data,i))
        {
        let index=i/4;
        let x=index%img.width;
        let y=Math.floor(index/img.width);
        let ball=new ImageBall(x+cx-img.width/2,y+cy-img.height/2);
        ImageBalls.push(ball);
        }
}

class ImageBall
{
    constructor(dx,dy)                                        //从随机位置到(dx,dy)
    {
        this.dx=dx;
        this.dy=dy;
        this.r=BallRadius;
        this.initialx=GetRandom(width);
        this.initialy=GetRandom(height);

        this.initialcolor={r:GetRandom(255),g:GetRandom(255),b:GetRandom(255)};
        this.color={r:200,g:22,b:29};

        this.x1=GetRandom(width);
        this.y1=GetRandom(height);
    }
    draw(count)
    {
        //计算在第count次时应该在的位置
        //(x1-x0,y1-y0)*count/AnimationMax+(x0,y0)
        let point=this.pos_t(Math.sin(count/AnimationMax*Math.PI/2));
        let x=point.x;
        let y=point.y;
        context.beginPath();
        context.arc(x,y,this.r,0,2*Math.PI);
        context.fillStyle=this.color_t(Math.sin(count/AnimationMax));
        context.fill();
    }
    pos_t(t)
    {
        //B2(t)=(1-t)*(1-t)*P0+2t(1-t)P1+t*t*P2
        //P0是initial,P2是(dx,dy)
        let x=(1-t)*(1-t)*this.initialx+2*t*(1-t)*this.x1+t*t*this.dx;
        let y=(1-t)*(1-t)*this.initialy+2*t*(1-t)*this.y1+t*t*this.dy;
        return {x:x,y:y};
    }
    color_t(t)
    {
        let r=(1-t)*this.initialcolor.r+t*this.color.r;
        let g=(1-t)*this.initialcolor.g+t*this.color.g;
        let b=(1-t)*this.initialcolor.b+t*this.color.b;
        return getrgb(r,g,b);
    }
}

function getrgb(r,g,b)
{
    if(r>255)r-=255;
    if(g>255)g-=255;
    if(b>255)b-=255;
    return "rgb("+r.toString()+","+g.toString()+","+b.toString()+")";
}

function animation(count)
{
    //前多少次放动画
    //后面固定
    context.clearRect(0,0,canvas.width,canvas.height);
    if(count>AnimationMax) count=AnimationMax;
    for(let i=0;i<ImageBalls.length;i++)
    {
        ImageBalls[i].draw(count);
    }


    count++;
    requestAnimationFrame(function () {
        animation(count);
    })

}

animation(0);